import React, { Component } from "react";
import './stage.css'
import Tasks from './Tasks'

class Stage extends Component {
    getTask=()=>{
        this.props.tasks.map((task)=>{
            <Tasks task={task}/>
       })
    }
  render() {
      const{tasks,stageName}=this.props
      console.log(tasks)
    return (
      <div name='Stage'>
       <h4>{stageName}</h4>
       {tasks.map((task)=>{
             <Tasks task={task}/>
        })}

       <button>Add Task</button>
      </div>
    );
  }
}

export default Stage;
